import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Profile = () => {
  const followerList = [
    { nickname: '강주한' },
    { nickname: '장재영' },
    { nickname: '글렌 맥퀸' },
  ];
  const followingList = [
    { nickname: '하선우' },
    { nickname: '윤구' },
    { nickname: '쪼람쥐' },
  ];

  return (
    <>
      <Head>
        <title>내 프로필 | NodeBird</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList header='팔로잉 목록' />
        <FollowerList header='팔로워 목록' />
      </AppLayout>
    </>
  );
};

export default Profile;
